import React from 'react';
import DatePicker from 'react-datepicker';
import { FaCalendarAlt, FaClock } from 'react-icons/fa';
import 'react-datepicker/dist/react-datepicker.css';

const BusBookingPage = () => {
  const [startDate, setStartDate] = React.useState(new Date());

  return (
    <div className="min-h-screen flex flex-col">
      <main className="flex-grow">
        {/* Hero Section */}
        <section className="relative h-[600px] bg-cover bg-center" style={{backgroundImage: 'url("/assets/busbg.png")'}}>
          <div className="absolute inset-0 bg-black bg-opacity-50"></div>
          <div className="relative container mx-auto px-4 h-full flex flex-col justify-center">
            <h1 className="text-white text-5xl font-bold mb-4">Reserve Your<br />Bus Tickets<br />Now</h1>
            <p className="text-white text-lg mb-8">Find and book your bus tickets with just a few clicks. We<br />offer a wide range of bus routes and schedules to suit<br />your needs.</p>
            <button className="bg-purple-600 text-white px-6 py-3 rounded-md font-semibold hover:bg-purple-700 transition duration-300 w-fit">
              Reserve Seat Now
            </button>
          </div>
        </section>

        {/* Booking Form */}
        <section className="container mx-auto px-4 -mt-16 relative z-10">
          <div className="bg-white rounded-lg shadow-lg p-6">
            <form className="grid grid-cols-1 md:grid-cols-3 lg:grid-cols-5 gap-4">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">From</label>
                <input type="text" placeholder="Select a location" className="w-full p-2 border border-gray-300 rounded-md" />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">To</label>
                <input type="text" placeholder="Select a location" className="w-full p-2 border border-gray-300 rounded-md" />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">Choose Date</label>
                <div className="relative">
                  <DatePicker
                    selected={startDate}
                    onChange={(date) => setStartDate(date)}
                    className="w-full p-2 border border-gray-300 rounded-md"
                    dateFormat="MM/dd/yyyy"
                  />
                  <FaCalendarAlt className="absolute right-3 top-1/2 transform -translate-y-1/2 text-gray-400" />
                </div>
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">Choose Time</label>
                <div className="relative">
                  <input type="time" className="w-full p-2 border border-gray-300 rounded-md" />
                  <FaClock className="absolute right-3 top-1/2 transform -translate-y-1/2 text-gray-400" />
                </div>
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">Total Seat</label>
                <input type="number" placeholder="Enter total seat" className="w-full p-2 border border-gray-300 rounded-md" />
              </div>
            </form>
            <button className="mt-4 w-full bg-purple-600 text-white px-6 py-3 rounded-md font-semibold hover:bg-purple-700 transition duration-300">
              Check Availability
            </button>
          </div>
        </section>
      </main>
    </div>
  );
};

export default BusBookingPage;
